// Function to inject SVG icons when page loads
document.addEventListener('DOMContentLoaded', function () {
    // Find all icon containers
    const iconContainers = document.querySelectorAll('.icon-container');

    // For each container, insert the appropriate SVG
    iconContainers.forEach((container) => {
        const iconType = container.getAttribute('data-icon');
        if (healthcareIcons[iconType]) {
            container.innerHTML = healthcareIcons[iconType];
        }
    });
});
